import React from "react";
import "./style.scss";
import icon2 from "../../assets/images/calendar.svg"
import icon1 from "../../assets/images/location.svg"

import { Location } from 'react-icons/fa';
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import {
  faLocation,
  faLocationPin,
  faMapLocation,
} from "@fortawesome/free-solid-svg-icons";
function SearchBar() {
  return (
    <div className="searchbar">
      <div>
        <div>
          <img src={icon1} alt="hi" className="searchbar__icon"></img>
          <div>Điểm đi</div>
        </div>
        <div>
          <input type="text" value={"Nơi xuất phát"}></input>
        </div>
      </div>
      <div>
        <div>
          <img src={icon2} alt="hi" className="searchbar__icon"></img>
          <div>Điểm đến</div>
        </div>
        <div>
          <input type="text" value={"Nơi xuất phát"}></input>
        </div>
      </div>
      <label>Điểm đến</label>
      <input type="text" value={"Nơi đến"}></input>
      <label>Ngày đi</label>
      <input type="date" value={"nơi xuất phát"}></input>
    </div>
  );
}

export default SearchBar;
